\@Override
public boolean equals\(Object o\) \{
if \(this \=\= o\) return true\;

if \(o \=\= null \|\| getClass\(\) \!\= o\.getClass\(\)\) return false\;

BaseDO baseDO \= \(BaseDO\) o\;

return new EqualsBuilder\(\)
\.append\(id\, baseDO\.id\)
\.isEquals\(\)\;
\}

\@Override
public int hashCode\(\) \{
return new HashCodeBuilder\(17\, 37\)
\.append\(id\)
\.toHashCode\(\)\;
\}
